define(['jquery'],function($){'use strict';return function(requestUrl,adobeAssetId,destinationPath){var deferred=$.Deferred();$.ajax({type:'POST',url:requestUrl,dataType:'json',showLoader:true,data:{'media_id':adobeAssetId,'destination_path':destinationPath},success:function(){deferred.resolve();},error:function(response){var message;if(typeof response.responseJSON==='undefined'||typeof response.responseJSON.message==='undefined'){message='Could not save the asset!';}else{message=response.responseJSON.message;}
deferred.reject(message);}});return deferred.promise();};});